export function findOutlier(integers: number[]): number {
   var evenNums = [];
   var oddNums = [];
   for (let num of integers) { 
       if ((num % 2) == 0)  {
           evenNums.push(num);
       } else {
           oddNums.push(num);
       }
   }
   var elen = evenNums.length;
   var olen = oddNums.length;

   if (elen &gt; olen) {
       return oddNums[0];
   } else {
       return evenNums[0];
   }
}

